import React from 'react';
import {
  Box,
  Flex,
  Text,
  Button,
  Stack,
  Icon,
  Link,
  Heading,
  Container,
  SimpleGrid,
  VStack,
  useColorModeValue,
  useBreakpointValue,
} from '@chakra-ui/react';
import { ChevronRightIcon } from '@chakra-ui/icons';
import { FaServer, FaRocket, FaShieldAlt, FaGlobe, FaClock, FaHeadset } from 'react-icons/fa';

export default function Index2() {
  return (
    <Box>
      <Box bg={useColorModeValue('gray.50', 'gray.900')} px={4}>
        <Flex h={16} alignItems={'center'} justifyContent={'space-between'}>
          <Box fontWeight="bold" fontSize="xl">NexusVPS</Box>

          <Flex alignItems={'center'}>
            <Stack direction={'row'} spacing={7}>
              {NAV_ITEMS.map((navItem) => (
                <Link
                  key={navItem.label}
                  p={2}
                  href={navItem.href ?? '#'}
                  fontSize={'sm'}
                  fontWeight={500}
                  color={useColorModeValue('gray.600', 'gray.200')}
                  _hover={{
                    textDecoration: 'none',
                    color: useColorModeValue('gray.800', 'white'),
                  }}
                >
                  {navItem.label}
                </Link>
              ))}
              <Button
                fontSize={'sm'}
                fontWeight={600}
                color={'white'}
                bg={'blue.400'}
                _hover={{
                  bg: 'blue.300',
                }}
              >
                Start Free Trial
              </Button>
            </Stack>
          </Flex>
        </Flex>
      </Box>

      <Box className="bg-gradient-to-r from-purple-400 via-pink-500 to-red-500 text-white">
        <Container maxW={'5xl'} py={12}>
          <Stack
            align={'center'}
            spacing={{ base: 8, md: 10 }}
            direction={{ base: 'column', md: 'row' }}
          >
            <Stack flex={1} spacing={{ base: 5, md: 10 }}>
              <Heading
                lineHeight={1.1}
                fontWeight={600}
                fontSize={{ base: '3xl', sm: '4xl', lg: '6xl' }}
              >
                <Text as={'span'}>
                  Powerful VPS Hosting
                </Text>
                <br />
                <Text as={'span'} color={'white'}>
                  for Your Business
                </Text>
              </Heading>
              <Text color={'gray.100'}>
                NexusVPS provides high-performance, secure, and scalable virtual private servers for businesses of all sizes. Experience lightning-fast speeds, 99.9% uptime, and 24/7 support.
              </Text>
              <Stack spacing={{ base: 4, sm: 6 }} direction={{ base: 'column', sm: 'row' }}>
                <Button
                  rounded={'full'}
                  size={'lg'}
                  fontWeight={'normal'}
                  px={6}
                  colorScheme={'red'}
                  bg={'red.400'}
                  _hover={{ bg: 'red.500' }}
                >
                  Get started
                </Button>
                <Button
                  rounded={'full'}
                  size={'lg'}
                  fontWeight={'normal'}
                  px={6}
                  leftIcon={<FaRocket />}
                >
                  How It Works
                </Button>
              </Stack>
            </Stack>
            <Flex
              flex={1}
              justify={'center'}
              align={'center'}
              position={'relative'}
              w={'full'}
            >
              <Box
                position={'relative'}
                height={'300px'}
                rounded={'2xl'}
                boxShadow={'2xl'}
                width={'full'}
                overflow={'hidden'}
              >
                <Icon
                  as={FaServer}
                  color={'white'}
                  w={64}
                  h={64}
                  position={'absolute'}
                  top={'50%'}
                  left={'50%'}
                  transform={'translate(-50%, -50%)'}
                />
              </Box>
            </Flex>
          </Stack>
        </Container>
      </Box>

      <Box p={4}>
        <Stack spacing={4} as={Container} maxW={'3xl'} textAlign={'center'}>
          <Heading fontSize={'3xl'}>Why Choose NexusVPS?</Heading>
          <Text color={'gray.600'} fontSize={'xl'}>
            We offer top-tier VPS solutions tailored to your needs. Our services combine performance, security, and reliability.
          </Text>
        </Stack>

        <Container maxW={'6xl'} mt={10}>
          <SimpleGrid columns={{ base: 1, md: 2, lg: 3 }} spacing={10}>
            {FEATURES.map((feature) => (
              <VStack key={feature.title} align={'start'}>
                <Flex
                  w={16}
                  h={16}
                  align={'center'}
                  justify={'center'}
                  color={'white'}
                  rounded={'full'}
                  bg={'gray.100'}
                  mb={1}
                >
                  <Icon as={feature.icon} w={10} h={10} color={'gray.500'} />
                </Flex>
                <Text fontWeight={600}>{feature.title}</Text>
                <Text color={'gray.600'}>{feature.text}</Text>
              </VStack>
            ))}
          </SimpleGrid>
        </Container>
      </Box>
    </Box>
  );
}

const NAV_ITEMS = [
  { label: 'Solutions', href: '#' },
  { label: 'Features', href: '#' },
  { label: 'Pricing', href: '#' },
  { label: 'Resources', href: '#' },
];

const FEATURES = [
  {
    icon: FaRocket,
    title: 'High Performance',
    text: 'Experience blazing fast speeds with our optimized VPS infrastructure.',
  },
  {
    icon: FaShieldAlt,
    title: 'Enhanced Security',
    text: 'Advanced security measures to keep your data safe and protected.',
  },
  {
    icon: FaGlobe,
    title: 'Global Network',
    text: 'Servers located worldwide for low-latency access from anywhere.',
  },
  {
    icon: FaClock,
    title: '99.9% Uptime',
    text: 'Reliable service with guaranteed uptime for your peace of mind.',
  },
  {
    icon: FaHeadset,
    title: '24/7 Support',
    text: 'Our expert team is always available to assist you with any issues.',
  },
  {
    icon: FaServer,
    title: 'Scalable Resources',
    text: 'Easily upgrade your VPS as your business grows and needs change.',
  },
];
